package com.github.kennycyb.uifactory.core.factory.impl.components.xinfo.tree;

import java.util.ArrayList;
import java.util.List;

import jakarta.xml.bind.annotation.XmlAttribute;
import jakarta.xml.bind.annotation.XmlElement;

import com.github.kennycyb.uifactory.core.factory.impl.components.xinfo.ComponentInfo;

/**
 * 
 * @since 1.0
 */
public class TreeInfo extends ComponentInfo {

	private String mText;

	@XmlAttribute
	public String getText() {
		return mText;
	}

	public void setText(final String text) {
		mText = text;
	}

	private final List<TreeInfo> mNodes = new ArrayList<TreeInfo>();

	@XmlElement(name = "node")
	public List<TreeInfo> getNodes() {
		return mNodes;
	}
}
